// Methods







// Rand 48 seed, with state = uint16_t * 3.
#define RANDSR48 fc6fc0cb
inline static void RANDSR48(void* state, uint32_t seed)
{
	register uint16_t* s = state;
	if (seed == 0U) s[0] = 0x330EU, s[1] = 0xABCDU, s[2] = 0x1234U;
	else s[0] = 0x330EU, s[1] = seed & 0xFFFFU, s[2] = (seed >> 16) & 0xFFFFU;
}


// Rand 48 generate, with state = uint16_t * 3.
#define RANDRG48 fd4f7342
inline static uint32_t RANDRG48(void* state)
{
	register uint16_t* s = state;
	uint32_t p = (uint32_t)s[0], q = (uint32_t)s[1], r = (uint32_t)s[2];
	register uint32_t a = 0xE66DU * p + 0x000BU;

	s[0] = (a & 0xFFFFU);
	a >>= 16;
	a += 0xE66DU * q + 0xDEECU * p;
	s[1] = (a & 0xFFFFU);
	a >>= 16;
	a += 0xE66DU * r + 0xDEECU * q + 0x0005U * p;
	s[2] = (a & 0xFFFFU);

	return ((uint32_t)s[2] << 16) + (uint32_t)s[1];
}


// In-place XOR ptr using sequence generated by RANDRG48, with state seeded by seed.
#define MXORPASS fd912b6e
inline static void* MXORPASS(void *restrict ptr, register size_t len, uint32_t seed)
{
	uint16_t s[3] = { 0U, 0U, 0U };
	RANDSR48(s, seed);
	register uint8_t* d = (uint8_t*)ptr;
	while (len-- > 0U) *d++ ^= RANDRG48(s);
	s[0] = s[1] = s[2] = 0U;
	return ptr;
}


// Identical to memcpy.
#define MYMEMCPY fa760de0
inline static void* MYMEMCPY(void *restrict p, const void *restrict q, size_t n)
{
	register const uint8_t* s;
	register uint8_t* d;

	if (p < q)
	{
		s = (const uint8_t*)q;
		d = (uint8_t*)p;
		while (n--) *d++ = *s++;
	}
	else
	{
		s = (const uint8_t*)q + (n - 1);
		d = (uint8_t*)p + (n - 1);
		while (n--) *d-- = *s--;
	}

	return p;
}


// Loads an encrypted procedure and makes it executable: ptr is the buffer of the code, len is the length, and key is the key to use.
#define LODMPROC f88fb6d1
inline static void* LODMPROC(void *restrict ptr, register size_t len, uint32_t key)
{
	uint8_t ok;
	void* r = malloc(len);
	if (r == 0) return 0;
	MYMEMCPY(r, ptr, len);
	MXORPASS(r, len, key);
	EMMKEXEC(r, len, ok);
	if (!ok) { free(r); r = 0; }
	return r;
}


